CREATE DATABASE BlackBeanSkinDB;
USE BlackBeanSkinDB;

-- Create table: 會員資料表 (Member Data Table)
CREATE TABLE MemberData (
    memberid INT PRIMARY KEY IDENTITY(1,1),
    username VARCHAR(50),
    gender VARCHAR(10),
    birthdate DATE,
    phone VARCHAR(20),
    email VARCHAR(100),
    membercreationdate DATE,
    country VARCHAR(50),
    city VARCHAR(50),
    region VARCHAR(50),
    street VARCHAR(100),
    postalcode VARCHAR(20)
);

CREATE TABLE CouponTicketData (
    coupon_id INT PRIMARY KEY IDENTITY(1,1),
    coupon_code VARCHAR(20),
    coupon_name VARCHAR(100),
    coupon_description NVARCHAR(400),
    minimum_amount INT,
    discount_percentage DECIMAL(5, 2),
    discount_amount INT
);

-- Create table: 優惠卷資料表 (Coupon Data Table)
CREATE TABLE UserCouponData (
    couponid INT PRIMARY KEY IDENTITY(1,1),
    memberid INT,
	used varchar(1),
    FOREIGN KEY (memberid) REFERENCES MemberData(memberid),
	FOREIGN KEY (couponid) REFERENCES CouponTicketData(coupon_id)
);


-- Create table: 商品分類資料表 (Product Category Data Table)
CREATE TABLE ProductCategoryData (
    categoryid INT PRIMARY KEY IDENTITY(1,1),
    categoryname VARCHAR(50),
    parentcategoryid INT
);

-- Create table: 商品基本資料表 (Product Basic Data Table)
CREATE TABLE ProductBasicData (
    productid INT PRIMARY KEY IDENTITY(1,1),
    sellermemberid INT,
    productname VARCHAR(100),
    price DECIMAL(10, 2),
    specialprice DECIMAL(10, 2),
    categoryid INT,
    productdetailid INT,
    quantity INT,
    description NVARCHAR(400),
    FOREIGN KEY (sellermemberid) REFERENCES MemberData(memberid),
    FOREIGN KEY (categoryid) REFERENCES ProductCategoryData(categoryid)
);



-- Create table: 商品圖片資料表 (Product Image Data Table)
CREATE TABLE ProductImageData (
    imageid INT PRIMARY KEY IDENTITY(1,1),
    productid INT,
    imagepath VARCHAR(200),
    FOREIGN KEY (productid) REFERENCES ProductBasicData(productid)
);

-- Create table: 商品評論資料表 (Product Review Data Table)
CREATE TABLE ProductReviewData (
    productid INT,
    memberid INT,
    rating INT,
    reviewcontent NVARCHAR(400),
    reviewtime DATETIME,
    PRIMARY KEY (productid, memberid),
    FOREIGN KEY (productid) REFERENCES ProductBasicData(productid),
    FOREIGN KEY (memberid) REFERENCES MemberData(memberid)
);

-- Create table: 問與答資料表 (Q&A Data Table)
CREATE TABLE QandAData (
    productquestionid INT PRIMARY KEY IDENTITY(1,1),
    productid INT,
    sellermemberid INT,
    buyermemberid INT,
    question NVARCHAR(400),
    answer NVARCHAR(400),
    questiontime DATETIME,
    answertime DATETIME,
    FOREIGN KEY (productid) REFERENCES ProductBasicData(productid),
    FOREIGN KEY (sellermemberid) REFERENCES MemberData(memberid),
    FOREIGN KEY (buyermemberid) REFERENCES MemberData(memberid)
);

-- Create table: 購物車資料表 (Shopping Cart Data Table)
CREATE TABLE ShoppingCartData (
    transactionid INT PRIMARY KEY IDENTITY(1,1),
    memberid INT,
    productid INT,
    quantity INT,
    FOREIGN KEY (memberid) REFERENCES MemberData(memberid),
    FOREIGN KEY (productid) REFERENCES ProductBasicData(productid)
);

-- Create table: 願望清單資料表 (Wishlist Data Table)
CREATE TABLE WishlistData (
    transactionid INT PRIMARY KEY IDENTITY(1,1),
    memberid INT,
    productid INT,
    FOREIGN KEY (memberid) REFERENCES MemberData(memberid),
    FOREIGN KEY (productid) REFERENCES ProductBasicData(productid)
);

-- Create table: 訂單基本資料表 (Order Basic Data Table)
CREATE TABLE OrderBasicData (
    orderid INT PRIMARY KEY IDENTITY(1,1),
    sellerid INT,
    memberid INT,
    merchanttradedate NVARCHAR(20),
    choosepayment NVARCHAR(20),
    totalamount INT,
    rating INT,
    reviewcontent NVARCHAR(400),
	merchantid NVARCHAR(10),
	merchanttradenno NVARCHAR(20),
	paymenttype NVARCHAR(20),
	tradedesc NVARCHAR(200),
	itemname NVARCHAR(400),
	returnurl NVARCHAR(200),
	checkmacvalue CHAR,
	encrypttype INT,
	clientbackurl NVARCHAR(200),
	itemurl NVARCHAR(200),
	orderresulturl NVARCHAR(200),
	needextrapaidinfo NVARCHAR(1),
    FOREIGN KEY (sellerid) REFERENCES MemberData(memberid),
    FOREIGN KEY (memberid) REFERENCES MemberData(memberid)
);

-- Create table: 訂單狀態資料表 (Order Status Data Table)
CREATE TABLE OrderStatusData (
    statusid INT PRIMARY KEY IDENTITY(1,1),
    statusname VARCHAR(50)
);

-- Create table: 訂單詳細資料表 (Order Detail Data Table)
CREATE TABLE OrderDetailData (
    orderdetailid INT PRIMARY KEY IDENTITY(1,1),
    orderid INT,
    productid INT,
    quantity INT,
    unitprice DECIMAL(10, 2),
    statusid INT,
    FOREIGN KEY (orderid) REFERENCES OrderBasicData(orderid),
    FOREIGN KEY (productid) REFERENCES ProductBasicData(productid),
    FOREIGN KEY (statusid) REFERENCES OrderStatusData(statusid)
);


